    def get_line_mod(self, list_buffer, functional, word):
        if word == 'Go':
            list_buffer += 'zz'
        elif word == 'Insert':
            list_buffer += 'zzI'
        elif word == 'Append':
            list_buffer += 'zzA'
        elif word == 'Change':
            list_buffer += ':.c{enter}'
